import React from "react";
import Layout from "../src/components/Layout";

const AboutPage = () => (
  <Layout className="body">
    <h1>About Us</h1>
    <p>Specula is an application</p>

    <style jsx>
      {`
        .body {
          display: flex;
          flex-direction: column;
        }
      `}
    </style>
  </Layout>
);

export default AboutPage;
